create table profileResponse
(
    profileID      int      not null,
    otherProfileID int      not null,
    response       char(10) null,
    createdAt      datetime not null,
    updatedAt      datetime not null,
    primary key (profileID, otherProfileID),
    constraint fk_profile_response_other_user
        foreign key (otherProfileID) references profile (id)
            on delete cascade,
    constraint fk_profile_response_user
        foreign key (profileID) references profile (id)
            on delete cascade
);

